summary:
The Forces Democratiques De Liberation Du Rwanda (FDLR) is one of the largest foreign armed groups operating in the territory of the Democratic Republic of the Congo (DRC). The group was formed in 2000, and, as detailed below, has committed serious violations of international law involving the targeting of women and children in armed conflict in the DRC, including killing and maiming, sexual violence, and forced displacement. According to a 2010 report from Amnesty International on Human Rights in the DRC, the FDLR were responsible for the killings of ninety-six civilians in Busurguni, Walikali territory. Some of the victims were burned alive in their homes. According to a 2010 report from Amnesty International on Human Rights in the DRC, in June 2010, an NGO medical centre reported around sixty cases a month of girls and women who had been raped in the southern Lubero territory, North-Kivu armed groups including the FDLR. According to a December 20, 2010 report from Human Rights Watch (HRW), there has been documented evidence of the FDLR actively conducting child recruitment. HRW has identified at least 83 Congolese children under the age of 18, some as young as 14, who have been forcibly recruited by the FDLR. In January of 2012, HRW reported that FLDR combatants attacked numerous villages in the Masisi territory, killing six civilians, raping two women, and abducting at least 48 people whose whereabouts remain unknown. According to a June 2012 report from HRW, in May 2012 FDLR fighters attacked civilians in Kamananga and Lumenje, in South Kivu province, as well as in Chambucha, Walikale territory, and villages in the Ufumandu area of Masisi territory, North Kivu province. In these attacks, FDLR fighters with machetes and knives hacked to death dozens of civilians, including numerous children. According to the June 2012 Group of Experts Report, the FDLR attacked several villages in South Kivu from December 31, 2011 to January 4, 2012. A United Nations investigation confirmed that at least 33 persons, including 9 children and 6 women, had been killed, either burned alive, decapitated or shot during the attack. In addition, one woman and one girl had been raped. The June 2012 Group of Experts Report also states that a United Nations investigation confirmed that the FDLR massacred at least 14 civilians, including 5 women and 5 children in South Kivu in May 2012. According to the November 2012 Group of Experts report, the UN documented at least 106 incidents of sexual violence committed by the FDLR between December 2011 and September 2012. The November 2012 Group of Experts report notes that, according to a UN investigation, the FDLR raped seven women in the night of 10 March 2012, including a minor, in Kalinganya, Kabare territory. The FDLR attacked the village again on 10 April 2012 and raped three of the women for the second time. The November 2012 Group of Experts report also reports 11 killings by the FDLR in Bushibwambombo, Kalehe on 6 April 2012, and FDLR involvement in 19 further killings in Masisi territory, including five minors and six women, in May. Email: Fdlr@fmx.de (mailto:Fdlr@fmx.de);
